function initDownloadBtns(){document.querySelectorAll(".download-btn").forEach(o=>o.onclick=async t=>{t.preventDefault();var t=o.dataset.url,e=o.dataset.filename;try{var a=URL.createObjectURL(await(await fetch(t)).blob()),n=Object.assign(document.createElement("a"),{href:a,download:e,style:"display: none"});document.body.append(n),n.click(),n.remove(),URL.revokeObjectURL(a)}catch(e){open(t,"_blank")}})}export{initDownloadBtns};